wer:"Met een Jimdo-webshop kun je betalingen rekenen in USD, AUD, CAD, CHF, CZK, DKK, EUR, GBP, HKD, ILS, MXN, MYR, NOK, NZD, PHP, PLN, RUB, SEK, SGD, THB, ARS, BRL, COP, INR, IDR, or ZAR. Bezoek Stripe en PayPal om te zien of jouw land ondersteund wordt.",grw997FAQCurrenciesQuestion:"Welke valuta ondersteunen jullie?",grw997FAQDomainsAnswer:"Nee, je hebt een Jimdo-website nodig om een domein bij ons te registreren. Kies een website- of webshoppakket en we helpen je het perfecte domein voor je bedrijf te vinden.",grw997FAQDomainsQuestion:"Kan ik een domein bij Jimdo kopen zonder website?",grw997FAQEmailAccountAnswer:"Ja, je kunt Google Workspace aan je Jimdo-website koppelen voor een e-mailadres dat bij je domein past (bijv. bestellingen@mijnbedrijf.nl). Je kunt een bestaand betaald Google-account gebruiken of een nieuw account aanmaken.",grw997FAQEmailAccountQuestion:"Krijg ik ook een professioneel e-mailadres?",grw997FAQHowToGetHelpAnswer:"De experts van ons support team staan voor je klaar via e-mail of chat. In ons [Help Center]((https://help.jimdo-dolphin.com/) ) vind je een bibliotheek vol handige gidsen.",grw997FAQHowToGetHelpQuestion:"Hoe krijg ik hulp?",grw997FAQNoOfDomainsAnswers:"Nog niet. Op dit moment ondersteunen we slechts n domein per website, maar dit verandert waarschijnlijk in de nabije toekomst.",grw997FAQNoOfDomainsQuestion:"Kan ik meer dan n domein gebruiken?",grw997FAQNoOfDomainsQuestion2:"Kan ik meer dan n domein gebruiken?",grw997FAQSubscriptionTermLengthAnswer:"Dat is aan jou! Je kunt je aanmelden voor 2 jaar, 1 jaar of per maand.",grw997FAQSubscriptionTermLengthQuestion:"Is er een lang contract?",grw997FAQSwitchTermAnswer:"Ja! Je kunt op elk moment upgraden vanuit je Jimdo Dashboard om toegang te krijgen tot meer professionele functies. Als je je pakket wilt downgraden, neem dan gewoon contact op met ons support team, dan helpen we je verder.",grw997FAQSwitchTermQuestion:"Kan ik later van pakket wisselen?",grw997FTCoreLabel:"basis",grw997H