peErrorPayeeAccountRestricted:"Siamo spiacenti, si  verificato un problema durante l'elaborazione del tuo pagamento. Per poter completare l'acquisto, contatta chi gestisce lo shop.",websiteStoreCheckoutStripeIbanBuyerEmail:"Email",websiteStoreCheckoutStripeIbanBuyerEmailHint:"Useremo questo indirizzo email per inviarti la conferma del pagamento.",websiteStoreCheckoutTitle:"Cassa",websiteStoreCreditCardLabel:"Carta di credito",websiteStoreDeliveryPolicyBodyText:"# Informazioni sulle spedizioni\n###Informazioni generali sulle spedizioni\nLa tabella sottostante mostra opzioni, costi e tempistiche di spedizione. \n\n###Informazioni importanti sulle spedizioni verso altri paesi \nImposte di dogana, tasse e altre commissioni non indicate nel prezzo finale potrebbero essere applicate in caso di spedizioni internazionali.",websiteStoreDeliveryPolicyCountries:"Paesi verso i quali spediamo i prodotti",websiteStoreDeliveryPolicyFreeShippingWithMinPrice:"Spedizione gratuita (ordine minimo {minimumOrderValue}{currency})",websiteStoreDeliveryPolicyFreeShippingWithMinPriceAndUp:"Spedizione gratuita (da {minimumOrderValue})",websiteStoreDeliveryPolicyPickupInfoHeadline:"Istruzioni e indirizzo per il ritiro",websiteStoreDeliveryPolicyRangeShipping:"Ordini da {minPrice} a {maxPrice}",websiteStoreDeliveryPolicyRangeShippingToInfinity:"Ordini da {minPrice} e oltre",websiteStoreDeliveryPolicyTableHeadCountry:"Opzione",websiteStoreDeliveryPolicyTableHeadDeliveryCost:"Costi",websiteStoreDeliveryPolicyTableHeadDeliveryDuration:"Orario di consegna",websiteStoreDeliveryPolicyTableHeadline:"Opzioni di consegna",websiteStoreDeliveryPolicyTableLableEU:"Paesi appartenenti all'UE",websiteStoreDeliveryPolicyTableLablePickup:"Ritiro locale (presso il nostro indirizzo)",websiteStoreDeliveryPolicyTableLableRestOfEurope:"Paesi non appartenenti all'UE",websiteStoreDeliveryPolicyTableLableWorldWide:"In tutto il mondo",websiteStoreDifferentBillingAddress:"Scegli un altro indirizzo di fatturazione",websit